import Navbar from './Navbar/Navbar'
import Categories from "./Categories/Categories";
import Adverts from "./Adverts/Adverts";
import Footer from "./Footer/Footer";

function App() {
  return (
      <BrowserRouter>
        <div className="App">
          <Navbar/>
          <Categories/>
          <Adverts/>
           <Route path={"/"} component={<Footer/>}>

           </Route>
        </div>
      </BrowserRouter>
  );
}

export default App;
